                    type: COMPONENT,
                    id: "component2"
                }]
            },
            {
                type: COLUMN,
                id: "column3",
                children: [{
                    type: COMPONENT,
                    id: "component3"
                }]
            },
            {
                type: COLUMN,
                id: "column4",
                children: [{
                    type: COMPONENT,
                    id: "component4"
                }]
            }
        ]
    }],
    components: {
        component0: { id: "component0", type: "I0.0", content: "contatoaberto" },
        component1: { id: "component1", type: "I0.1", content: "contatoaberto" },
        component2: { id: "component2", type: "I0.2", content: "contatofechado" },
        component3: { id: "component3", type: "I0.3", content: "contatoaberto" },
        component4: { id: "component4", type: "O0.0", content: "capacitor" }
    }
};

export default initialData;
